import "./App.css";
import React from "react";
import { BrowserRouter as Router, Routes, Route, Link, useParams } from "react-router-dom";
import { userParams } from "react-router-dom"

function Home() {
  return <h2 className="text-center text-4xl font-bold mt-10">Home Page</h2>;
}

function About() {
  return <h2 className="text-center text-4xl font-bold mt-10">About Page</h2>;
}

function Contact() {
  return <h2 className="text-center text-4xl font-bold mt-10">Contact Page</h2>;
}

function NotFound() {
  return <h2 className="text-red-600 text-center text-6xl font-bold mt-10">Page Not Found</h2>;
}

function UserProfile() {
  let { username } = useParams();
  return <>
  <span className="text-center text-4xl font-bold mt-10">Profile of </span>

  <span className="text-blue-600 text-center text-4xl font-bold mt-10"> {username}</span>
  </>

}

function App() {
  return (
    <Router>
      <nav>
        <Link to="/">Home</Link> |
        <Link to="/about">About</Link> |
        <Link to="/contact">Contact</Link> |
      </nav>

      <Routes>
        <Route path="/" element={<Home />} />
        <Route path="/about" element={<About />} />
        <Route path="/contact" element={<Contact />} />
        <Route path="/*" element={<NotFound />} />
        <Route path="/user/:username" element={<UserProfile />} />
      </Routes>
    </Router>
  );
}

export default App;
